import React from 'react';
import { ChevronUp, X } from 'lucide-react';
import './ManageDataSection.css';

const ManageDataSection = () => {
  return (
    <div className="manage-data-section">
      <div className="section-header">
        <div className="section-title">
          <h2>Manage Data</h2>
        </div>
        <div className="section-controls">
          <ChevronUp size={20} />
          <X size={20} />
        </div>
      </div>

      <div className="section-details">
        <p className="ip-details">Select Details(49.36.191.241, New Delhi, India (Fresh IP))</p>
        <p className="count-details">Complete Count :- 277009</p>
      </div>
    </div>
  );
};

export default ManageDataSection;
